INSERT INTO `movie` VALUES (1,'Auli‘i Cravalho, Dwayne Johnson, Rachel House, Temuera Morrison, Nicole Scherzinger, Hualālai Chung, David Fane, Rose Matafeo, Awhimai Fraser, Gerald Ramsey, Khaleesi Lambert-Tsuda','Hoạt Hình','David G. Derrick Jr.',99,1,'Tiếng Anh - Phụ đề Tiếng Việt; Lồng tiếng','https://lumiere-a.akamaihd.net/v1/images/p_moana2_payoff_5787a994.jpeg','“Hành Trình của Moana 2” là màn tái hợp của Moana và Maui sau 3 năm, trở lại trong chuyến phiêu lưu cùng với những thành viên mới. Theo tiếng gọi của tổ tiên, Moana sẽ tham gia cuộc hành trình đến những vùng biển xa xôi của Châu Đại Dương và sẽ đi tới vùng biển nguy hiểm, đã mất tích từ lâu. Cùng chờ đón cuộc phiêu lưu của Moana đầy chông gai sắp tới nhé.','HÀNH TRÌNH CỦA MOANA 2','P - PHIM DÀNH CHO MỌI ĐỐI TƯỢNG','2024-12-04','“Hành Trình của Moana 2”','https://lumiere-a.akamaihd.net/v1/images/p_moana2_payoff_5787a994.jpeg','https://www.youtube.com/embed/cBG30KsGRH8?si=tfNceEDCLBJhSzoi'),(2,'Tom Hardy, Juno Temple, Chiwetel Ejiofor, Clark Backo, Stephen Graham','Hành Động, Khoa Học Viễn Tưởng, Phiêu Lưu, Thần thoại',' Kelly Marcel',109,1,'Tiếng Anh - Phụ đề Tiếng Việt','https://upload.wikimedia.org/wikipedia/vi/a/a3/Venom_The_Last_Dance_Poster.jpg','Đây là phần phim cuối cùng và hoành tráng nhất về cặp đôi Venom và Eddie Brock (Tom Hardy). Sau khi dịch chuyển từ Vũ trụ Marvel trong ‘Spider-man: No way home’ (2021) trở về thực tại, Eddie Brock giờ đây cùng Venom sẽ phải đối mặt với ác thần Knull hùng mạnh - kẻ tạo ra cả chủng tộc Symbiote và những thế lực đang rình rập khác. Cặp đôi Eddie và Venom sẽ phải đưa ra lựa quyết định khốc liệt để hạ màn kèo cuối này.','VENOM: KÈO CUỐI','C13 - PHIM CẤM KHÁN GIẢ DƯỚI 13 TUỔI','2024-10-25','Đây là phần phim cuối cùng và hoành tráng nhất về cặp đôi Venom và Eddie Brock (Tom Hardy). Sau khi dịch chuyển từ Vũ trụ Marvel trong ‘Spider-man: No way home’ (2021) trở về thực tại, Eddie Brock giờ đây cùng Venom sẽ phải đối mặt với ác thần Knull hùng mạnh - kẻ tạo ra cả chủng tộc Symbiote và những thế lực đang rình rập khác. Cặp đôi Eddie và Venom sẽ phải đưa ra lựa quyết định khốc liệt để hạ màn kèo cuối này.','https://upload.wikimedia.org/wikipedia/vi/a/a3/Venom_The_Last_Dance_Poster.jpg','https://www.youtube.com/embed/id1rfr_KZWg?si=mRAzzeh3reATFoAq'),(4,'Song Luân, NSƯT Thành Lộc, Kaity Nguyễn, Đoàn Thiên Ân, Công Dương, NS Thanh Thủy, NSƯT Hữu Châu,…','Hài, Tâm Lý, Tiểu Sử','Lý Minh Thắng',113,1,'Tiếng Việt - Phụ đề Tiếng Anh','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRCyDyWrRIx-stmYacO6vFMn1ENx08c5mt_Kg&s','Lấy cảm hứng từ giai thoại nổi tiếng của nhân vật được mệnh danh là thiên hạ đệ nhất chơi ngông, Công Tử Bạc Liêu là bộ phim tâm lý hài hước, lấy bối cảnh Nam Kỳ Lục Tỉnh xưa của Việt Nam. BA HƠN - Con trai được thương yêu hết mực của ông Hội đồng Lịnh vốn là chủ ngân hàng đầu tiên tại Việt Nam, sau khi du học Pháp về đã sử dụng cả gia sản của mình vào những trò vui tiêu khiển, ăn chơi trác tán – nên được người dân gọi bằng cái tên Công Tử Bạc Liêu.','CÔNG TỬ BẠC LIÊU','T13 - Phim được phổ biến đến người xem từ đủ 13 tuổi trở lên (13+)','2024-12-06','Công Tử Bạc Liêu.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRCyDyWrRIx-stmYacO6vFMn1ENx08c5mt_Kg&s','https://www.youtube.com/embed/7oVbS8zQxQ0?si=Vjuhd6n5unU3o7YZ'),(5,'Ayana Taketatsu, Ayane Sakura, Inori Minase, Kana Hanazawa, Miku Itō, Yoshitsugu Matsuok','Hoạt hình','Masato Jinbo',47,1,'Tiếng Nhật - Phụ đề Tiếng Việt; Lồng tiếng','https://cdn.galaxycine.vn/media/2024/11/26/the-quintessential-quintuplets-specials-2-1_1732590802325.jpg','Anime Nhà Có 5 Nàng Dâu / Gotōbun no Hanayome Special 2 xoay quanh chuyến du lịch của Futaro và 5 chị em nhà Nakano, cũng là tuần trăng mật của Futaro và Yotsuba.','NHÀ CÓ NĂM NÀNG DÂU SPECIALS 2','T13 - Phim được phổ biến đến người xem từ đủ 13 tuổi trở lên (13+)','2024-11-29','Anime Nhà Có 5 Nàng Dâu / Gotōbun no Hanayome Special 2 ','https://cdn.galaxycine.vn/media/2024/11/26/the-quintessential-quintuplets-specia